import React from 'react';
import './App.css';
import Navbar from './Navbar';
import './styles.css'
import Pricing from './Pricing';
import About from './About';


function App() {
  let Component;
  switch (window.location.pathname) {
    case "/":
      Component = App
      break
    case "/pricing":
      Component = Pricing
      break
    case "/about":
      Component = About
      break
  }
  return (
    <>
      < Navbar />
      <Component />
    </>
  )
}

export default App;
